import './App.css';
import SearchBar from './components/SearchBar';
import { Switch, Route } from 'react-router-dom';
import Bugs from './components/Bugs';
import SeaCreatures from './components/SeaCreatures';
import Fish from './components/Fish';

function App() {
  return (
    <div className="App">
      <h1>Animal Crossing New Horizons Critter Finder</h1>
      <SearchBar />
      <Switch>
                <Route path="/bugs">
                    <Bugs month={month} hour={hour} />
                </Route>

                <Route path="/sea">
                    <SeaCreatures />
                </Route>

                <Route path="/fish">
                    <Fish />
                </Route>
            </Switch>
    </div>
  );
}

export default App;
